  - name: TEXT4000
    number: '6'
    value: 'This amended filing responds to the Commission''s RFAIs of February 26
      and March 24, 2010. Some transfers from the Democratic National Committee''s
      State Partnership Program were incorrectly identified as proceeds from the WI
      Party Victory Fund joint fundraising program on the committee''s June 2009 monthly
      through 2009 year-end reports. Records correction propagated errors in the reported
      year-to-date totals over this period. This amendment corrects those entries
      and makes consistent the reported year-to-date totals.  Payroll related items
      on Schedule H4 of this report were for employees that spent 25% or less of their
      compensated time on Federal activity. Any Receipts on Line 15 or 17 were accessed
      at the usual and normal charge.  Any fundraising Expenses on Line 21b were for
      the benefit of the committee and did not support a federal candidate.

